import React from "react";
import logo from "./logo.png";
const Header = props => {
  return (
    <header className="m-2 text-center bg-dark p-3 rounded">
      <div>
        <img className="img-fluid max-width: 100%" src={logo} alt="Logo" />;
        <div>
          <h2 className="text-warning">Movie Watchlist</h2>
          <h6 className="text-white">u/{props.auth}</h6>
        </div>
      </div>
    </header>
  );
};

export default Header;
